def generate_fibonacci(N: int) -> list[int]:
    if N < 0:
        return []
    result = [0] * N
    (f1, f2) = (1, 1)
    if N >= 1:
        result[0] = f1
    if N >= 2:
        result[1] = f2
    for i in range(2, N):
        f = f1 + f2
        f2 = f1
        f1 = f
        result[i] = f
    return result

